function BordHeaderTitleLabel(props) {

  const style = {
    fontWeight: "bolder"
  };

  return (
    <div>
      <span className="bordTitle" style={style}>{props.title}</span>
    </div>
  );
}

export default BordHeaderTitleLabel;
